import React from 'react'

function ButtonFilter({button, filter}) {
    return (
        <div>
            {
                button.map((cat, i)=>{
                    return <button type="button" onClick={()=> filter(cat)} className="btn">{cat}</button>
                })
            }
        </div>
    )
}

export default ButtonFilter;
